import './App.css';
import Navigation from './screens/navigationBar/navigationBar';
import Particles from './components/Particles';

function App() {
  return (
    <div className="App">
      <Navigation />
      <a
          className="App-link"
          href="https://particles.js.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          tsParticles
        </a>
    </div>
  );
}

export default App;
